1470	CGH14-050	34	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show a roughly oval mass of melanocytes within fibrofatty tissue. At the periphery of the mass are cords and strands of small, round cells with relatively scant pale cytoplasm and monomorphous oval nuclei containing small nucleoli. These cells are separated by thickened collagen bundles in some areas, with a few melanophages. The center of the lesion is more cellular. There are sheets of cells with inconspicuous pale cytoplasm and considerably larger, vesicular nuclei with moderately enlarged reddish nucleoli. Several mitotic figures are evident (but usually 1-2 per mm square). There are occasional multinucleated cells, as well as pseudovascular spaces within the masses of melanocytes. The enclosed immunostains include positive S100 and Melan-A stains, as well as an HMB-45 stain which marks both the smaller and larger melanocytes.	Twelve outside slides, SC14-637:A/1,A/2, XPS-14-931:B/1,B/2 (including five unstained slides cut from block A/1) and two corresponding blocks.	THIRD OPINION, NO HISTORY OF MELANOMA, PRESENT FOR YEARS AND HAD POSSIBLY BEEN INCREASING IN SIZE SLIGHTLY, INTRAOPERATIVELY IT SHELLED OUT EASILY AND DID NOT APPEAR TO BE CONNECTED OR INVOLVING THE OVERLYING EPIDERMIS; THROMBOSED VESSEL	\N	\N	\N	The HMB-45 staining of both components of the lesion is in keeping with both populations deriving from a blue nevus, probably a cellular blue nevus (the quotation marks reflect my unhappiness with the common/cellular dichotomy). The more cellular population lacks the typical nested, or lobular peninsula-like architecture of a cellular blue nevus, nuclei are somewhat enlarged and crowded, and the mitotic rate is higher than in most such lesions. However, the striking cytologic atypia, necrosis and lymphocytic infiltrate seen in some melanomas arising in blue nevi are not evident here. Some would term the current changes atypical blue nevus, a term I am not fond of but may have some applicability in this case. In keeping with this borderline character, comparative genomic hybridization shows an aberration not typically seen in melanoma. There is a gain involving chr. 9, which is often lost in melanoma. A re-excision of this area seems appropriate. In the reference below, the number of aberrations seen in blue nevus-like melanoma was higher than in atypical blue nevi or in conventional cellular blue nevi; with one aberration, and that one not typically associated with melanoma, this intermediate category seems best.  Reference:  Maize JC Jr, McCalmont TH, Carlson JA, Busam KJ, Kutzner H, Bastian BC. Genomic analysis of blue nevi and related dermal melanocytic proliferations. Am J Surg Pathol. 2005 Sep;29(9):1214-20.	ATYPICAL MELANOCYTIC PROLIFERATION ARISING IN A CELLULAR BLUE NEVUS	173788	2603	\N	L	14-15427	A	SYNAT258	2010-2017	IP1365348	AirTable blocks_with_IP_info.csv
