2729	13-75788B	45	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	198.2	\N	\N	Sections show nodular aggregations of large, epithelioid cells similar to those in (A), with more nuclear pleomorphism and hyperchromasia. There is variably intense staining with low molecular weight, and pan-keratin.	Seven outside slides, 12SSH7050 (1A - 1A3) and one corresponding block (1A), received 9-25-13.	PT WITH METASTATIC MELANOMA TO THE LYMPH NODES, NO PRIMARY EVER FOUND, HALO NEVUS ENLARGING (POSSIBLE CGH)	\N	\N	\N	The findings in the hematoxylin and eosin-stained sections in (A)suggested a Spitz's nevus with a halo reaction. While the morphology suggested a BAP-1 mutation, staining for BAP-1 did not show loss of nuclear staining, as would point to a mutation in that gene (present in a specific subset of Spitz's nevi and other spitzoid lesions). One can occasionally see retention of immunohistochemical staining with BAP-1 mutations, however. Immunostaining using two colors (MART-1/tyrosinase labeled red, Ki-67 labeled brown) shows a relatively low proliferation rate in the dermal melanocytes. Given the keratin positivity in (B) I also obtaining a keratin stain in (A), but it is negative.  A Fontana stain shows complete loss of melanin from the basal layer of the epidermis, in keeping with the history of a halo. Comparative genomic hybridization in (A) did not show chromosomal gains or losses, a finding that is strongly against melanoma.  We also reviewed the sections from the metastasis, see part (B) below. Staining for BAP-1 in (B) shows no loss of that protein (the same result as in (A). Comparative genomic hybridization shows multiple chromosomal gains and losses, indicating a level of genomic instability found in melanoma and not in nevi. While the hybridization was of low quality (probably due to the presence of necrosis en masse), there were gains in 3q, 5p, 6p, 8q and 10p, and losses in 6q, 9 and 10p, among others.  In sum, the findings point to the two lesions as being unrelated.	METASTATIC MELANOMA	173541	666	\N	\N	13-75788	B	DP-29	CGH Validation	IP1317793	AirTable blocks_with_IP_info.csv
2730	14-11769	14	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show enlarged fusiform melanocytes arrayed irregularly within the epidermis and dermis in large fascicles that are centrally maturing, an melanocytes in mitosis are easily found in the upper dermis. The background epidermis is acanthotic and verrucous, and the fibrotic encompassing dermis holds a lymphohistiocytic infiltrate and ectatic vessels.	Two outside slides, EFG17-14 (1-2) and one corresponding block Jo-13-1-20651-2.	FOR 2 MONTHS HAD SOMETIMES BLEEDING LESION; NEVUS, HEMANGIOMA, R/O MELANOMA	\N	\N	\N	My differential diagnosis included a hyperproliferative polypoid Spitz nevus, an HRAS-mutated Spitz nevus, and spitzoid melanoma. Based solely upon the examination of microscopic sections, I initially favored either of the former two possibilities as most likely, but I cannot fully exclude melanoma based solely upon histopathologic parameters. (An HRAS-mutated Spitz nevus has now been excluded from the differential diagnosis on molecular grounds, as is discussed further in the sentences that follow.) Per your request, we completed comparative genomic hybridization (CGH) as part of our assessment. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed loss in distal chromosome 6q with no other associated chromosomal gains or losses. Loss in chromosome 6q can be seen in association with melanoma but typically involves the MYB gene; in this instance, the loss of 6q may fall distal to the MYB gene locus. There is not gain in chromosome 11p present, and thus an HRAS-mutated Spitz nevus can be excluded from diagnostic consideration.  In summary, the combination of results derived from conventional microscopy coupled with CGH has not produced an entirely straightforward result. The differential diagnosis lies between an atypical Spitz nevus/tumor with associated distal chromosome 6q loss on one hand and spitzoid melanoma of 3.4 mm in thickness on the other. As melanoma cannot be excluded from the differential diagnosis, I believe that melanoma should be considered the functional diagnosis for this case.  If staged as melanoma, this non-ulcerated tumor is between 2-4 mm and thus represents stage pT3a (2009 AJCC Guidelines). Complete local removal has already been achieved.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	POLYPOID COMPOUND PROLIFERATION OF ENLARGED SPITZOID MELANOCYTES, 3.4 MM IN THICKNESS, EXCISED IN THE AVAILABLE PLANES OF SECTION	123298	667	\N	\N	14-11769	\N	DP-30	CGH Validation	IP1361690	AirTable blocks_with_IP_info.csv
2731	14-42631	23	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.5	\N	\N	Sections show a roughly symmetrical compound melanocytic proliferation with a domed surface.  The overlying epidermis is thickened, with hyperplasia of the spinous layer, hypergranulosis and compact hyperkeratosis. Situated at the epidermal-dermal junction are nests of large oval melanocytes, some of which are separated from the epidermis by clefts.  The junctional melanocytes have abundant cytoplasm and large vesicular nuclei. Kamino bodies (dull pink globules) are present. Many melanocytes have abundant, pale cytoplasm and dusty appearing melanin and strikingly large, pleomorphic vesicular nuclei.	One outside slide, JS-14-25671 / A1, and one corresponding block.	DARK IRREGULARLY PIGMENTED PLAQUE, PT HAS A COUPLE OF OTHER SMALLER LIGHTER NEVI ON BUTTOCKS ALSO; NEOPLASM OF UNCERTAIN BEHAVIOR VS. COMPOUND NEVUS, R/O ATYPIA OR DYSPLASIA	\N	\N	\N	Per your cover letter, we performed comparative genomic hybridization. This unusual lesion has the silhouette of a Spitz's nevus, and has many Kamino bodies. However, many of the lesional melanocytes are pulverocytes* and some nuclei near the base of the specimen have strikingly atypical nuclei. Comparative genomic hybridization shows multiple chromosomal gains and losses, indicating a level of genomic instability found in melanoma and not in nevi. There is a small interstitial deletion in chr. 4q of unknown significance. Areas of loss involving chr. 9q are present. Losses involving chr. 9 or 9p are the most common aberrations in melanoma; losses of 9q with preservation of 9p are less common and seem less significant. A small interstitial gain within chr. 10q is present. The most important aberration is a cluster of high level amplifications and losses involving chr. 12q. These include an amplification that my colleague, Dr. Iwei Yeh pointed out to me includes the CDK4 locus. In past work from our group, gains of CDK4 were seen in melanomas that were wild type for b-raf and n-ras.  Given the above findings, a spitzoid melanoma rather than a spitzoid melanoma is the best interpretation for this neoplasm, despite the presence of Kamino bodies.  *This term is introduced in Massi G, LeBoit P. Histologic Diagnosis of Nevi and Melanoma, 2nd Edition, Springer-Verlag, Berlin Heidelberg, 2014 p. 57, and refers to cells with abundant, pale cytoplasm and dusty appearing melanin, deriving from the Latin term for dust; such cells, referred to by the late Dr. A. Bernard Ackerman as pagetoid melanocytes (a confusing term, as it can be used for cells with pagetoid scatter) are unusual in Spitz's nevus.	MELANOMA, 0.95 MM. IN THICKNESS	173507	668	\N	\N	14-42631	\N	DP-31	CGH Validation	IP1392565	AirTable blocks_with_IP_info.csv
