nvasion, or regression. Tumor lies adjacent to small nerve twigs. It is difficult to know if this merely reflects diffuse involvement of the dermis in such areas, which I favor, rather than true neurotropism.  Complete excision of this site is of course warranted. The patient may also be a candidate for sentinel node sampling, based on the guidelines used in many institutions.	MELANOMA, 2.75 MM IN THICKNESS, ARISING IN ASSOCIATION WITH A MELANOCYTIC NEVUS, EXTENDING VERY CLOSE TO THE PERIPHERAL MARGIN, WITH NEVUS PRESENT AT THE PERIPHERAL MARGIN	173688	135	\N	\N	07-28805	\N	CCR-032	California Cancer Registry,Melanoma Epigenetics	IP651337	AirTable blocks_with_IP_info.csv
