ns that are conclusively diagnostic of childhood-type melanoma. Summing all of the available information, I favor an unconventional Spitz nevus as the best overall classification for this case. Complete reexcision of this site will be necessary in follow-up, but no other surgical intervention is indicated once local clearance has been achieved.  Dr. Denianke, I would be happy to discuss this case with you by telephone.	ATYPICAL COMPOUND SPITZOID MELANOCYTIC PROLIFERATION, TRANSECTED AT THE SPECIMEN PERIPHERY	424655	240	\N	\N	12-26470	\N	CGH12-109	Nevus Library	IP1112288	AirTable blocks_with_IP_info.csv
