2206	17-112474	67	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	172.5	\N	\N	None	Block DL17-76060 (S17-8234), received 11-16-17.	ORIGINALLY READ AS DL17-76060; REACCESSIONED FOR CGH TESTING	\N	\N	Scraping	Following microdissection and DNA extraction, we performed comparative genomic hybridization. The hybridization shows gain of chr. 6p, and a loss involving an area on chr. 6q with the ARID1B gene near its breakpoint. Gain of 6p and loss of 6q are commonly found together in melanoma, and the finding of a breakpoint at a gene important in melanomagenesis further supports that diagnosis. The biopsy and re-excision from this lesion correlate for an approximate thickness of 6 mm. A beta-catenin immunostain labels not only the cytoplasm of the lesional melanocytes but also their nuclei. This supports the assessment of a deep penetrating nevic lineage, per a recent study from our group. This lineage includes deep penetrating nevus, indeterminate lesions, and deep penetrating nevus-like melanoma.  In the re-excision, the neoplasm was a fraction of a mm. from the deep margin near the center of the specimen, and a further excision (still deeper, but not necessary wider) seems warranted.  The comparative genomic hybridization data was also reviewed by my colleague, Dr. Boris Bastian who agrees with this interpretation of it.  Reference:  Yeh I, Lang UE, Durieux E, Tee MK, Jorapur A, Shain AH, Haddad V, Pissaloux D, Chen X, Cerroni L, Judson RL, LeBoit PE, McCalmont TH, Bastian BC, de la Fouchardire A. Combined activation of MAP kinase pathway and -catenin signaling cause deep penetrating nevi. Nat Commun. 2017 Sep 21;8(1):644. doi: 10.1038/s41467-017-00758-3. PubMed PMID: 28935960; PubMed Central PMCID: PMC5608693.	MELANOMA, WITH DEEP PENETRATING NEVUS-LIKE FEATURES, 6  MM. IN THICKNESS	273588	246	\N	\N	17-112474	\N	CGH17-240	Nevus Library	IP1806028	AirTable blocks_with_IP_info.csv
2207	18-95536	47	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	172.7	DPN-mm	\N	The microscopic findings are essentially as described in the accompanying pathology report and in the note above.	Seven outside slides, S-18-32980 A1 / HST18-053114 / HST18-055181, and one corresponding block.	18 X 13 MM BLACK PLAQUE; ATYPICAL NEVUS VS. MELANOMA	\N	\N	Scraping	The strong nuclear beta-catenin positivity favors this being in the deep penetrating nevic series, rather than in the classic blue nevic one. The focus of necrosis, and high proliferation rate were features worrisome for a deep penetrating nevus-like melanoma. This diagnosis has been confirmed by molecular studies. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows loss of chr. 10, which is a highly characteristic chromosomal copy number change seen in melanoma, with gains in both chr. 11p and 11q (the gain in chr. 11p is of higher amplitude). The former hints at an h-ras mutation. While h-ras mutated Spitz's nevi have isolated chr. 11p gains, and behave benignly, the presence of additional changes in this case means that its presence does not favor benignity. There is also a loss involving chr. 13q.  My colleague, Dr. Iwei Yeh also viewed the comparative genomic hybridization results, and the sections and agreed with this diagnosis. One of the deep penetrating nevus-like melanomas in our study had an h-ras mutation.  Reference:  Yeh I, Lang UE, Durieux E, Tee MK, Jorapur A, Shain AH, Haddad V, Pissaloux D, Chen X, Cerroni L, Judson RL, LeBoit PE, McCalmont TH, Bastian BC, de la Fouchardire A. Combined activation of MAP kinase pathway and -catenin signaling cause deep penetrating nevi. Nat Commun. 2017 Sep 21;8(1):644. doi: 10.1038/s41467-017-00758-3. PubMed PMID: 28935960; PubMed Central PMCID:PMC5608693.	MELANOMA, 2.2 MM. IN THICKNESS	173727	247	\N	\N	18-95536	\N	CGH18-137	Deep Penetrating Melanoma	IP1959535	AirTable blocks_with_IP_info.csv
