2760	16-30292	11	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	There is a mostly intradermal proliferation of large, oval and polygonal melanocytes with abundant homogeneous appearing cytoplasm and large, pleomorphic vesicular nuclei, singly and in small nests in the dermis without much maturation and dispersion with descent.	Seven outside slides, S16-4576-A1, and one corresponding block.	MOLE; R/O CANCER	\N	\N	\N	The differential diagnosis includes an atypical Spitz tumor and a spitzoid melanoma. There is nearly complete loss of p16 staining, which can correlate with one of the common genomic aberrations seen in melanocytic neoplasm, bi-allelic loss of chr. 9p, where the gene, CDKN2A that encodes p16 is located. This loss of staining can also occur by epigenetic means, and is not entirely specific for melanoma. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows a gain involving chr. 2, and losses involving chrs. 6q and 9. The depression in the CGH array graph suggests heterozygous rather than homozygous chr. 9 loss. Losses of chrs. 6q and 9 are common aberrations seen in atypical Spitz tumors and in melanoma, but not in conventional Spitz's nevi.  Following microdissection and DNA extraction, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations.  Based on these findings, I favor an atypical Spitz tumor. These are neoplasms that have features more atypical than those of a conventional Spitz nevus, but n