h spitzoid features.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of melanoma. Rather, our analysis has identified an uncommon monoaberration that we have identified in a subset of Spitz nevi or partially transformed Spitz tumors. In the available sections, this melanocytic proliferation appears narrowly excised. Clinical monitoring of the biopsy site can be utilized to verify that no persistence ensues. Given the complexity of this assessment, conservative complete reexcision of this site could also be considered as follow-up management.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	COMPOUND PROLIFERATION OF HEAVILY PIGMENTED MELANOCYTES, CONSISTENT WITH A COMPOUND MELANOCYTIC NEVUS	897777	643	\N	\N	14-90528	\N	DP-06	Possible TERT Fusion	IP1440512	AirTable blocks_with_IP_info.csv
