2749	15-87833	15	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show a compound proliferation of spitzoid melanocytes. Along the junction, there are melanocytes arranged as nests and single cells mostly within the lower epidermis. Many of the melanocytes are epithelioid and contain abundant eosinophilic cytoplasm, while some are more spindled. The overlying epidermis is acanthotic and hypergranulotic. Within the dermis, there are nests and some near sheets of similar melanocytes. Scattered dermal mitotic figures are apparent among dermal melanocytes, including some in the deep dermis. In some areas, there is diminishment in the size of melanocytes with descent into the dermis, while in other foci, large epithelioid melanocytes are present in the lower portion of the proliferation.	One hematoxylin and eosin-stained section prepared from outside block labeled 15-6056-A.	SECOND OPINION, R/O WART (SEE PHOTO)	\N	\N	\N	In the initial routine section, there were two populations of Spitzoid melanocytes. One population was composed of relatively small epithelioid melanocytes that diminished in size with descent and that were located mostly at the periphery of the proliferation. The other population was composed of large epithelioid melanocytes, many with atypical nuclei and some in mitosis, that formed large nests and near sheets within the central aspect of the specimen. This central population of melanocytes was concerning for Spitzoid melanoma while the peripheal population was suggestive of a Spitz nevus. In order to further evaluate this neoplasm, I performed immunoperoxidase staining. A phosphohistone H3/Melan-A two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) demonstrates a non-trivial number of melanocytes in mitosis within the dermal component of this proliferation.  Staining with p16 demonstrates significant loss of p16 staining among melanocytes within the central aspect of the proliferation (i.e. those concerning for Spitzoid melanoma) but no loss in the peripheral melanocytes. This loss can correlate with one of the common genomic aberrations seen in melanocytic neoplasm, bi-allelic loss of chr. 9p, where the gene, CDKN2A that encodes p16, is located. This loss of staining can also occur by epigenetic means, and is not entirely specific for melanoma. Nonetheless, detection of this loss within the morphologically atypical melanocytes is concerning. While I favored a Spitzoid melanoma arising in a Spitz nevus for the above mentioned reasons, I did not think that an unequivocal diagnosis could be rendered based on the above data. Therefore, after receiving authorization from the clinical team, I (1) completed FISH analysis for chromosome 9p in order to determine if the loss of p16 staining mentioned above represented an authentic mutation in this genetic locus of an epigenetic phenomenon and (2) completed array-based comparative genomic hybridization (aCGH) since FISH analysis only tests for one genetic locus.  The FISH testing did not show homozygous loss of chromosome 9p and thus the loss of p16 appears to be an epigenetic phenomenon.  The aCGH reveals a small sub-centromeric gain on chromosome 1q, a loss on chromosome 6q and a gain of chromosome 21q. The loss on chromosome 1 is bordered by TPM3, which is a gene involved in a range of fusions, and thus it is possible that a fusion has occurred. While the presence of these three abnormalities detected on the aCGH is worrisome, it is not sufficiently atypical to render an unequivocal diagnosis of Spitzoid melanoma. I think it is best to regard this lesion as representing an atypical Spitz tumor, which is a Spitzoid neoplasm that shows more atypicality than a conventional Spitz tumor but is not sufficiently atypical to warrant an unequivocal diagnosis of Spitzoid melanoma. Fusions occur relatively frequently in atypical Spitz tumors, which might have been the case herein.  Given that this proliferation extends to the base and peripheral aspect of the specimen, I think that it should be re-excised with a few millimeters of a margin.  My colleagues, Dr. Timothy McCalmont and Boris Bastian, also reviewed these sections and agree with this assessment.	BIPHASIC ATYPICAL SPITZOID TUMOR, EXTENDING TO THE BASE AND PERIPHERAL ASPECT OF THE SPECIMEN	132799	686	\N	\N	15-87833	\N	DP-49	CGH Validation	IP1559454	AirTable blocks_with_IP_info.csv
