ay of aberrations, including evidence of a complex pattern of chromosomal fragmentation and re-jointing of chr. 7q, a loss involving chr. 10p and the pericentromeric area of 10q, two narrow areas of gain on chr 15 within the TRPM1 and MYO5A genes, respectively, a loss involving chr. 21q, and gain involving the pericentromeric area of chr. 22p with a breakpoint at the MAPK1 gene. Of these, chr. 10 loss if often found in melanoma, and complex chromosomal rearrangments like the one involving chr. 7q also point to melanoma. MAPK1 gain is present in only 1.5% of melanomas, with an unknown percentage having a focussed gain involving a narrow area around the gene. Whether the gains involving TRPM1 and MYO5A, both of which are involved in melanocytic tumor progression are significant or not is unknown.  The reporting of this case was delayed, as I wanted to go over the comparative genomic hybridization data with my colleagues, Dr. Boris Bastian and Iwei Yeh.	MELANOMA, AT LEAST 2.5 MM. IN THICKNESS	582721	700	\N	\N	16-41709	\N	DP-63	CGH Validation	IP1641025	AirTable blocks_with_IP_info.csv
