2766	16-19890	15	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.3	\N	\N	The microscopic findings are essentially as described in the accompanying pathology report and in the note above.	Three outside slides, 16S-01754 1A1-1B2. Three additional slides (ALK-1 & p16 stains for A1) received 3/14/16. Three additional slides (ALK-1 & p16 stains for 1B) received 3/18/16. One corresponding block (1B) received 3/30/16.	2ND OPINION, NEVUS; NUB	\N	\N	\N	This proliferation of spitzoid cells shows large bulbous aggregations extending into the subcutis, as can be seen both in atypical Spitz tumors and spitzoid melanoma. There are mitotic figures in the deep portion of the lesion, including some so-called marginal mitoses. As there are thin, pointed ridges and long, vertically oriented fascicles, I suggested an ALK immunostain (along with p16). The stained sections have now been received. The ALK stain is negative, excluding that variant of spitzoid neoplasm. There is a mosaic pattern of staining for p16, sufficient to exclude the possibility of a bi-allelic deletion of chr. 9p, which can be found in melanoma (the absence of which does not exclude the diagnosis, however).  The differential diagnosis included an atypical Spitz tumor and spitzoid melanoma.  Following microdissection and DNA extraction, we performed comparative genomic hybridization. Comparative genomic hybridization shows multiple chromosomal gains and losses, indicating a level of genomic instability found in melanoma and not in nevi. These included gains involving chromosomes 2p, 3p, 4p, and 8q and losses involving 3q and 4q. C-myc is on chr. 8q, and gains of this chromosome are a repeatable aberration in melanoma, while many of the other aberrations are not.  Currently, I use the term spitzoid melanoma, childhood type, for an emerging class of lesions that usually but not exclusively occur in children and teens, lack b-raf mutations (which are present in most melanomas in adults) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma. These are findings that would support conservative treatment. Most lesions of this type are deeper, but usually not much wider than their exophytic portions, and even when they are, are well circumscribed. While sentinel nodes are often positive, this positivity has much less predictive value for systemic spread than is the case with adult melanoma.  We will contact you if testing for hTERT promoter mutations again becomes available in our lab.  ADDENDUM, June 29, 2016:  Per my discussion with Dr. Dohil, we will be performing hTERT promoter mutation analysis; please expect results in 2-3 weeks.  ADDENDUM, July 13, 2016:  Following microdissection and DNA extraction, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Hence, even though the designation spitzoid melanoma may be apt morphologically, the prognosis would be expected to be better than in conventional melanomas of this thickness.  Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	SPITZOID MELANOMA, 3.5 MM. IN THICKNESS	173305	703	\N	\N	16-19890	\N	DP-66	CGH Validation	IP1619017	AirTable blocks_with_IP_info.csv
