2788	17-9550	38	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show an asymmetrical compound proliferation of hyperchromatic melanocytes. Within the epidermis, which is partially thinned, there is single melanocytes and nests distributed nearly confluently, and associated pagetoid scatter is noted. In the dermis below this, incompletely maturing nests, cords, fascicles, and small syncytia of finely pigmented melanocytes are noted, and interstitial melanophages are also apparent. Pigmentation by melanocytes is retained through all of the thickness of the dermal component. Reevaluation of the intraepidermal component in a recut section, after the receipt of the molecular result, affirms that much of it is composed of fusiform melanocytes in fascicles.	Three outside slides, CT17-1057, and one block.	NEVUS ON THE RIGHT DORSAL FOOT OF PATIENT, THE PATIENT BELIEVES IT HAS BEEN PRESENT FOR MANY YEARS, ALTHOUGH THE DERMATOLOGIST QUESTIONS HIS ACCURACY AS A HISTORIAN, ATYPICAL NEVUS, NEVOID MM	\N	\N	\N	My differential diagnosis included an atypical melanocytic nevus on one hand and nevoid melanoma on the other, and based upon the analysis delineated in the sentences that follow, it becomes clear that the former possibility represents the best overall categorization. Your submitted phosphohistone-H3 immunostain demonstrates that the mitotic index is low, but this finding is of little diagnostic comfort, as the mitotic rate in many examples of nevoid melanoma approaches zero. Immunohistochemistry for p16 was additionally completed and demonstrates mosaic positivity, and this implies that biallelic loss in CDKN2A is not apparent in this tumor. (If biallelic loss was present, it would compellingly favor the diagnosis of melanoma.) The defined findings were certainly plausible as an atypical melanocytic nevus, but I did not feel that nevoid melanoma of 0.75 mm in thickness could be excluded on histopathologic grounds. In light of this and as per your authorization, we additionally completed array-based comparative genomic hybridization (aCGH) to screen for chromosomal copy number gain or loss, as would be expected in association with melanoma. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosome 7q with loss of telomeric chromosome 6q (not involving the MYB gene) with no other associated gains or losses. The gain in chromosome 7q includes a spike in the vicinity of 7q34, and this finding suggests that BRAF gene fusion has occurred. As background for fully understanding the molecular result, note that most melanomas analyzed via aCGH demonstrate multiple associated significant chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations or show a monoaberration, as is apparent here (the loss of telomeric 6q is trivial and is not of larger diagnostic significance, and thus the gain in 7q qualifies as a monoaberration).  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced confirmation of a diagnosis of nevoid melanoma. Rather, I believe the proliferation represents a partially transformed melanocytic nevus with underlying BRAF gene fusion. Returning to the slide after analyzing the molecular findings, there are subtle spitzoid characteristics that I did not fully appreciate in my prior evaluation. Based upon these findings coupled with the molecular result, I believe this melanocytic nevus is best categorized within the spectrum of Spitz nevus.  Gene fusion, including BRAF gene fusion, represents a not uncommon mechanism of induction of Spitz nevi and Spitz tumors. Such tumors are only minimally or partially transformed and typically hold no larger clinical potential. With that said, as this biopsy is only partial in nature, conservative complete reexcision can be considered as follow-up management. The intent of reexcision is simply to ensure complete removal and verify that persistence with additional transformation cannot ensue.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	ATYPICAL COMPOUND SPITZ NEVUS WITH BRAF GENE FUSION, INVOLVING THE DEEP EDGE OF THE BIOPSY	173788	725	\N	\N	17-9550	\N	DP-88	CGH Validation	IP1738711	AirTable blocks_with_IP_info.csv
