2795	17-48219	17	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show a proliferation of melanocytes with two separate cellular components (a biphasic pattern). There are both small conventional melanocytes in nests and syncytia as well as large fusiform and ovoid melanocytes with finely pigmented cytoplasm. The latter cells are arrayed in coalescing nests, cords, fascicles, and syncytia throughout the upper and lower reticular dermis and also in the adventitial dermis without clear circumscription. In the upper dermis, some fusiform melanocytes are enlarged. A robust deep lymphohistiocytic infiltrate with admixed melanophages is also noted -- and this includes some lymphoid follicles. There are also fascicles that encompass peripheral nerves.	21 slides, CE-17-001314 A1 & A2 (17-3142 A & B) and two blocks.	? SPITZ NEVUS, R/O DYSPLASTIC NEVUS, ? DERMATOFIBROMA	\N	\N	\N	The discussion that follows has been modified to integrate molecular results. This unusual tumor includes both conventional melanocytic nevus and a secondary component resembling a deep penetrating nevus, and the latter component exhibits associated neurotropism and adnexotropism. Your immunoperoxidase stains demonstrate that expression of p16 is generally preserved and that the Ki-67 cell proliferation index is low, and both of these labeling results are as would be expected with a melanocytic nevus, or at least do not provide clear support to interpretation as melanoma. Immunostaining for beta catenin was included in our evaluation and is negative. Some but not all examples of deep penetrating nevus exhibit nuclear positivity with beta catenin immunohistochemistry, as activating mutations in beta catenin are common to their pathogenesis.  In terms of potential considerations in the differential diagnosis, I found myself unable to render a diagnosis of neurotropic melanoma (arising in conjunction with a melanocytic nevus) on histopathologic grounds, but obviously the finding of marked neurotropism is extreme and unusual. To clarify the diagnosis, we additionally completed array-based comparative genomic hybridization (aCGH) to screen for chromosomal copy number gain or loss, as per your authorization. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed loss in chromosome 1p, focal loss in telomeric chromosome 2q, and gain in telomeric chromosome 7q, including the region where BRAF is encoded. This unusual molecular result with multiple small aberrations does not provide support to interpretation as frank melanoma but also indicates that this proliferation does not represent any form of conventional melanocytic nevus. In short, these combined histopathologic and molecular results suggest a partially transformed tumor; the findings we have defined are roughly equivalent to what is often termed 'atypical Spitz tumor'. My colleague, Dr. Iwei Yeh, also reviewed the molecular results for this case and is in agreement that the defined findings do not support interpretation as melanoma.  The neurotropic component of this unusual tumor extends focally to the inked specimen margin. Reexcision to obtain a free margin is recommended.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	ATYPICAL COMBINED DEEP PENETRATING NEVUS-LIKE MELANOCYTIC PROLIFERATION WITH ASSOCIATED NEUROTROPISM	173526	732	\N	\N	17-48219	\N	DP-95	CGH Validation	IP1777827	AirTable blocks_with_IP_info.csv
