3553	13-105024A	11	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	173.9	\N	\N	There is a proliferation of large oval and fusiform melanocytes that are predominantly situated in the dermis, forming large confluent nests at the junction of an irregularly hyperplastic epidermis with a domed surface. There is marked nuclear pleomorphism, with many of the cells having scant cytoplasm, resulting in an appearance where nuclei appear to overlap. Many of these nuclei are vesicular, with large nucleoli. Maturation with descent is faulty. Large aggregates are present at the base of the lesion. There is a dense lymphocytic infiltrate underlying the lesion.	One hematoxylin and eosin-stained section prepared from outside blocks labeled 67397 (A-B).	NOT PROVIDED	\N	\N	\N	While the scanning microscopic appearance raises the possibility of a Spitz's nevus, the degree of confluence of junctional nests, the high nuclear to cytoplasmic ratio, the large nucleoli and the failure to mature uniformly with descent are all findings that favor a spitzoid melanoma over a Spitz's nevus. Additionally, while the lesion appears to have a flat base at scanning magnification, that base is provided by lymphocytes. When one looks at the contour of the melanocytic proliferation itself, it is quite uneven. A p16 immunostain performed in our laboratory shows a near absence of staining. This can correlate with bi-allelic loss of chr. 9p. or chr. 9, but is not as strong evidence for the genomic loss as would be fluorescence in situ hybridization or comparative genomic hybridization testing. Currently, I use the term Spitzoid melanoma, childhood type, for an emerging class of lesions that usually but not exclusively occur in children and teens, usually lack b-raf mutations (which are present in most melanomas in adults) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma. These are findings that would support conservative treatment. Most lesions of this type are deeper, but usually not much wider than their exophytic portions, and even when they are, are well circumscribed. While sentinel nodes are often positive, this positivity has much less predictive value for systemic spread than is the case with adult melanoma. Hence, the thickness of 2.1 mm would result in a prognosis that is much more grim than a lesion such as this one would ordinarily have. A narrow re-excision and clinical follow-up is preferable to more aggressive treatment.	SPITZOID MELANOMA, CHILDHOOD TYPE	666955	1358	\N	\N	13-105024	A	SMP12	Spitz Melanoma	IP1347042	AirTable blocks_with_IP_info.csv
