nt among lesional melanocytes, that many of the melanocytes have large, hyperchromatic nuclei, and the melanocytes are arranged as sheets, we are still quite concerned that the findings in this biopsy represent those of a spitzoid melanoma. If a melanoma has chromosomal aberrations that are copy number neutral, CGH will not show any aberrations, which could explain the normal CGH data in this case. If this lesion does represent a melanoma, it is 8.5 millimeters in thickness. However, as you know, spitzoid melanomas in children tend to behave in a less aggressive fashion compared with conventional melanomas of equivalent thickness. Therefore, the thickness measurement mentioned above should be interpreted in this context.  The residual melanoma present in this specimen is located at least 6 millimeters from all of the inked margins.  My colleagues, Drs. Timothy McCalmont, Philip LeBoit and Boris Bastian have seen these sections and agree with this assessment.	SCAR AND RESIDUAL INTRADERMAL PROLIFERATION OF LARGE, SPITZOID MELANOCYTES, CONCERNING FOR SPITZOID MELANOMA	173304	1357	\N	\N	12-24027	C	SMP11	Spitz Melanoma	IP1104428	AirTable blocks_with_IP_info.csv
