1156	11-51553	14	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.3	\N	\N	There is a compound proliferation of melanocytes that extends into the deep reticular dermis. The epidermis overlying the proliferation is thinned. There are nests and single melanocytes along the junction, and most have abundant pale, vacuolated cytoplasm and some have enlarged oval vesicular nuclei. A limited degree of pagetoid scatter is present. Within the subjacent dermis there are coalescing nests, cords, and small syncytia of similar-appearing cells, some of which have even more abundant cytoplasm or larger and more hyperchromatic nuclei. Interspersed amidst these cells are foci in which melanocytes with smaller and more monomorphous nuclei predominate. Near the base of the proliferation are lymphoid nodules. A permeative component to the infiltrate in the reticular dermis is also noted.	One outside slide, D11-25135 and one corresponding block.	CHANGING MOLE WHICH BLEEDS OCCASIONALLY AND HAS BEEN PRESENT FOR ONE AND A HALF YEARS	\N	\N	\N	The findings are not those of a conventional congenital, Spitz or deep penetrating melanocytic nevus. Immunoperoxidase staining using two colors (with MART-1/tyrosinase labeled red and Ki-67 labeled brown) shows a relatively low cell proliferation index. However, some positively-labeled nuclei are apparent even in the deep dermis, which is of concern. We also completed array-based comparative genomic hybridization (aCGH) to further address the differential diagnosis between melanocytic nevus and melanoma. After extraction of tumoral DNA from the tissue block, application of aCGH revealed segmental gain in chromosome 7p and also in 7q. The presence of multiple chromosomal copy number aberrations indicates genomic instability and favors interpretation as melanoma. We have not observed gain in chromosome 7 in melanocytic nevi of any type.  In summary, the combination of results derived from conventional microscopy coupled with aCGH favors interpretation as an unconventional melanoma occurring in childhood. We refer to tumors within this spectrum as childhood-type melanomas. The designation childhood-type melanoma refers to an emerging tumor category that we believe is distinct from conventional (or adult-type) melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination.  This tumor is 4.2 mm in thickness and is non-ulcerated. Further excision is warranted to ensure that local eradication has been accomplished. I have received a call from Dr. Saadia Raza and will be returning her call to discuss the case.	ATYPICAL COMPOUND PROLIFERATION OF MELANOCYTES; GAIN IN CHROMOSOMES 7p AND 7q APPARENT VIA COMPARATIVE GENOMIC HYBRIDIZATION	173304	2612	\N	\N	11-51553	\N	SYNAT582	2010-2017	IP1040993	AirTable blocks_with_IP_info.csv
