n 1 mm in thickness and lacks associated ulceration, yet melanocytes in mitosis are detectable in its dermal component. Therefore, this represents melanoma of stage pT1b (2009 AJCC Guidelines). Further excision is warranted to ensure that local eradication has been accomplished.	MELANOMA OF 0.85 MM IN THICKNESS, NARROWLY EXCISED IN THE AVAILABLE PLANES OF SECTION	173727	2846	\N	\N	11-52339	\N	SYNAT583	2010-2017	IP1041779	AirTable blocks_with_IP_info.csv
