 of results derived from conventional microscopy coupled with aCGH points to interpretation as melanoma. This is a non-ulcerated melanoma with associated Clark's level IV invasion. The final microstage parameters should be reassessed once this melanoma has been fully extirpated.	MELANOMA OF 0.95 MM IN THICKNESS	173765	2890	\N	\N	11-55993	\N	SYNAT584	2010-2017	IP1045436	AirTable blocks_with_IP_info.csv
