10796	13-94484	3	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	Iwei Translocation	CGH13-394 	Sections show melanocytes arrayed in compound fashion in a large polypoid skin segment. There are single melanocytes and large pale nests of melanocytes within the epidermis, and limited intraspinous scatter is noted. In the vast subjacent dermis in the center of the polyp, there is a large nodular population of melanocytes that is somewhat biphasic. There are smaller ovoid and fusiform melanocytes arrayed as nests, cords, fascicles, and syncytia, and there is also a large syncytial population of enlarged epithelioid melanocytes with amphophilic or pale cytoplasm. A patchy lymphohistiocytic infiltrate is noted as well.	Two outside slides, S13-5421. One corresponding block received 11-18-13.	\N	\N	\N	\N	This large polypoid tumor does not represent a variant of conventional Spitz nevus. Rather, our differential diagnosis includes an unusual combined melanocytic nevus or unconventional Spitz nevus, an 'atypical Spitz tumor' (a provisional diagnostic category), and childhood spitzoid melanoma. We completed BAP-1 immunoperoxidase staining as part of our evaluation, as BAP-1 loss (within chromosome 3p) can be detected in a subset of Spitz tumors with enlarged epithelioid melanocytes, similar to those seen here. The BAP-1 immunostain demonstrates preserved nuclear positivity throughout, thereby indicating that BAP-1 loss is not present. This is the type of challenging tumor for which array-based comparative genomic hybridization (aCGH) can be of value. This technique was applied, as per your approval. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in distal chromosome 7 with no other associated chromosomal gains or losses. Gain in chromosome 7q suggests a Spitz nevus with associated MET genetic fusion. MET immunostaining was additionally completed and demonstrates positivity, thereby corroborating the possibility suggested in the preceding sentence.  This is an unusual melanocytic tumor. I believe it is benign, but follow-up studies of tumors of this type have not been completed. Conservative complete reexcision of this site would be reasonable to consider to ensure complete tumor removal and prevent persistence.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	POLYPOID COMPOUND PROLIFERATION OF ENLARGED EPITHELIOID MELANOCYTES, CONSISTENT WITH AN UNCONVENTIONAL POLYPOID SPITZ NEVUS	173707	1933	\N	\N	13-94484	A	SYNX530	\N	IP1336499	Consolidated_data_final.csv
