1302	14-16247	31	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	There is a dome-surfaced compound proliferation of melanocytes featuring markedly elongated, jagged ridges and large oval and fusiform cells with variable amounts of amphophilic cytoplasm and large nuclei, amongst which mitotic figures can be discerned. Fewer of these, and some maturation are present at the base of the lesion, which is relatively flat, and beneath which is a dense lymphocytic infiltrate.	Two outside slides, SPS-14-7904:AI,AII and two corresponding blocks.	ATYPICAL COMPOUND MELANOCYTIC NEOPLASM WITH SPITZOID FEATURES	\N	\N	\N	The silhouette is that of a Spitz's nevus, but I am concerned about the crowding of nuclei and the presence of a focally high mitotic rate. Immunostaining using two colors (MART-1/tyrosinase labeled red, Ki-67 labeled brown) shows a relatively high proliferation rate in the dermal component (about 10-15%). A p16 immunoperoxidase stain show a mosaic pattern of loss of that tumor suppressor gene product, an indeterminate pattern. Comparative genomic hybridization shows a gain involving chr. 2p, and a complex combination of gains and losses involving chr. 7q. The breakpoints suggest a gene fusion involving MET on chr. 7 and DTCN1 on chr. 2p, a combination that Dr. Iwei Yeh, who also viewed the comparative genomic hybridization data has previously noted. This may lead to upregulation of braf (near one of the other breakpoints on 7q), in the absence of braf mutation. While the absence of other chromosomal gains and losses is somewhat reassuring, it would be best to view this as a lesion with limited but non-zero metastatic potential, e.g. as an atypical Spitz. These are neoplasms that have feature more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results 