2716	11-12273	2	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.2	\N	\N	Sections show a cellular, exophytic, polypoid compound proliferation of melanocytes. Within the background epidermis, which is thin, there are single melanocytes and nests distributed erratically, and cells above the junction can be found. The dermis below this contains large and irregular nests of similar melanocytes that lack maturation with descent in the dermis. An increase in dermal vascularity is appreciable. Dermal melanocytes in mitosis are easily found.	Seven outside slides, S10-40898 A1 (DC11-357, DEE-12580) and one corresponding block.	LARGE PEARLY PAPULE ON L PINNA FOR 2-3 WEEKS; FAVOR PYOGENIC GRANULOMA	\N	Iwei, CGH Array run| ROS1 Translocation case	\N	Our differential diagnosis included childhood-type spitzoid melanoma on one hand and a peculiar cellular Spitz nevus on the other. To address this differential, we completed array-based comparative genomic hybridization (aCGH) analysis to screen for melanoma-associated genomic anomalies. After extraction of tumoral DNA from the tissue block, aCGH analysis demonstrated gain in chromosome 1q and loss of chromosome 6q. The identification of multiple chromosomal gains and losses is not known to occur in Spitz nevi and favors instead the above interpretation. The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination.  This proliferation has not been adequately excised. Further excision is warranted to ensure that local eradication has been accomplished.	CHILDHOOD-TYPE SPITZOID MELANOMA OF 2.9 MM IN THICKNESS	102270	653	\N	\N	11-12273	\N	DP-16	CGH Validation	IP1001710	AirTable blocks_with_IP_info.csv
