2717	11-23710	9	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.3	\N	KF-09, AND DP-17 are the same patient	Sections show enlarged spindled and fusiform melanocytes arrayed in nests and fascicles in compound fashion. Large nests and fascicles are apparent at the junction in concert with acanthosis (and also central erosion), and many coalescing fascicles reside in the dermis and upper subcutis below that in concert with a lymphohistiocytic infiltrate. There is only partial maturation with descent. Dermal melanocytes in mitosis can be found, especially in the upper half of the proliferation.	Five outside slides, S11-11651 and one corresponding block.	PYOGENIC GRANULOMA	\N	Iwei, CGH Array run| ROS1 Translocation case	\N	As you note in your correspondence regarding this case, this proliferation does not represent a conventional Spitz nevus. The lesion is ulcerated, has a high overall cellularity and has a nodular component in the subcutis. Comparative genomic hybridization shows loss of chromosome 6q, an aberration that is common in melanoma. There is also a gain of a small area in the distal part of 5q. Given these findings, I believe that this is best assessed as a spitzoid melanoma of childhood. I use this term for an emerging class of lesions that usually lack b-raf mutations (which are present in most melanomas) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma.  While the thickness is approximately 4.5 mm., it would be a mistake to use prognostic data from adult melanoma cases in this setting. The prognosis is far better. As the lesion extends to a dermal margins, a narrow re-excision is reasonable. Lesions of this type are usually well circumscribed, and I have not seen regrowth when narrow but clear margins have been obtained. The role of sentinel lymph nodes is debatable, as sentinel lymph node involvement is common, but distant metastasis is rare.	SPITZOID MELANOMA, CHILDHOOD TYPE	173307	654	\N	\N	11-23710	\N	DP-17	CGH Validation,Fusion RNA	IP1013148	AirTable blocks_with_IP_info.csv
