2862	11-5482	15	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	Sections show an exophytic, eroded compound proliferation of enlarged spindled and epithelioid melanocytes. Intraepidermally, these cells are distributed in concert with marked epidermal hyperplasia. At the junction, there are cellular nests and fascicles of melanocytes that often hold a vertical orientation, and some large nests show central necrosis en masse within them. There are cellular fascicles, cords, and nests of cytologically similar melanocytes that descend into the dermis below this, where partial maturation with descent is appreciable. Dermal melanocytes in mitosis or single necrotic melanocytes are easily found. A juxtaposed sparse lymphohistiocytic infiltrate is apparent within fibrotic peritumoral dermis.	One outside slide, HS11-1031.  Twenty-one additional slides (20 unstained) received 2-3-11.	1.0 CM ERYTHEMATOUS CRUSTED TENDER PAPULE, RECENT CHANGE IN SIZE, AND BLEEDING	\N	\N	\N	I believe this proliferation represents childhood-type spitzoid melanoma not a peculiar or atypical Spitz nevus. To further substantiate this interpretation, we completed comparative genomic hybridization via array methodology (aCGH) to screen for melanoma-associated genomic anomalies. After extraction of tumoral DNA from the tissue block, aCGH analysis revealed gain in chromosomes 7q and 12p. The presence of multiple chromosomal gains is not known to occur in Spitz nevi and favors instead the above interpretation. The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination.  This tumor is transected at the deep edge of the biopsy. Further excision is warranted to ensure that local eradication has been accomplished.	CHILDHOOD-TYPE SPITZOID MELANOMA OF AT LEAST 4.0 MM IN THICKNESS, INVOLVING THE DEEP EDGE OF THE BIOPSY	192799	778	\N	\N	11-5482	\N	KF-05	Fusion RNA	IP994919	AirTable blocks_with_IP_info.csv
